import { addText, getDistance } from "../common/common-functions.js";
import { Particle } from "./elements.js";

const canvas = document.getElementById("canvas");
canvas.width = 640;
canvas.height = 427;
const ctx = canvas.getContext('2d');
const mouse = {
    x : null,
    y: null,
    radius : 150
}
let image = new Image();
image.src = "data:image/jpeg;base64,";


// functions
function init() {
   ctx.drawImage(image, 0, 0, canvas.width, canvas.height);
   let scanedImage = ctx.getImageData(0, 0, canvas.width, canvas.height);
//    console.log(Object.getOwnPropertyDescriptor(scanedImage, "data"));
   Object.defineProperty(scanedImage, "data", {writable: true});
   let scanedImageData = scanedImage.data;
   

   for (let i = 0; i < scanedImageData.length; i++) {
    let total = scanedImageData[i] + scanedImageData[i+1] + scanedImageData[i+2];
    let averageColorVal = total / 3;
    scanedImageData[i] = averageColorVal;
    scanedImageData[i+1] = averageColorVal;
    scanedImageData[i+2] = averageColorVal;
    
   }
   scanedImage.data = scanedImageData;
   ctx.putImageData(scanedImage, 0, 0);

   
}



//event
addEventListener("mousemove", e => {
    mouse.x = e.clientX;
    mouse.y = e.clientY;
})

image.addEventListener("load", init)